Lizz and Missy are a lesbian couple who visit a strip-club headlined by local starlet, Dani. After seeing her perform on stage they decide to buy a lapdance from her. However, it would appear that they bought more than they bargained for as Dani has never danced for a lesbian couple before and as such, has tons of questions for them. Having had enough of her constant pestering, Lizz and Missy decide to teach Dani a lesson in what it's like to be a lesbian
